message:
Detalhamento do Edital

- Datalhar refeições realizadas de um Edital;
- Edição do edital;
- Resumo de beneficiários do Edital.

Análise e correção do código para Migração do Sábado Letivo

- Ajuste na aplicação web: view, controller e service;
- Ajuste no serviço de migração;
- Criação do campo migração no Dia de Refeição.

Custo da Refeição

- Adicionar campo de custo na refeição;
- Parser e máscara para o campo monetário do custo.

Atualização dos dados do Aluno para pretensão.

- Ajuste no controller e navegação;
- Ajuste na validação do serviço.

Criação da entidade Nível

- Criação da entidade nível;
- Modificação no nome da coluna nm_periodo.

Ajuste na exibição de informações no Edital e Dia de Refeição

- Exibição da validade do edital;
- Ajuste no botão de remoçao do Edital.

Remoção de edital

- Remoção de edital;
- Ajuste nos perfis de acesso aos serviços do edital.

Ajuste na Refeição e Edital para Pretensão

- Remoção dos campos de Refeição:  quentidade de dias previstos para
retensao e previsão da pretensao;
- Adição em Edital de previsão da pretensão;
- Tratamento de campos booleanos na listagem do Edital;
- Correção de texto em Funcionário;
- Aperfecoamento do interceptador para respostas com erro.

Listagem do dia da refeição para editais válidos

Ajuste na listagem dos dias de refeição para editais válidos;
Edital com previsão da pretensão da refeição.

Login com chave de autenticação

- Geração de chave de autenticação para o usuário logado;
- Definição do setor do usuário.

Login Funcionário

- Inclusão do campo Setor no Funcionário;
- Login do usuário com registro do browser e chave de acesso.

Atualização nao serviço de inserção do Aluno

- Validação de aluno;
- Inserção do campo de campus.

Edital

- Controle de dias de refeição via Edital;
- Listar editais vigentes para inserção do dia de refeição.

Edital e Dia de Refeição

- Campo de quantidade de contemplados no edital;
- Inserção do Edital no Dia da Refeição.

Inserção de funcionário

- Ajuste do serviço de cadastro do funcionário;
- Criação do serviço de cadastro e listagem de role.

Submissão de arquivos

- Criação da entidade de persistência das informações de arquivo;
- Criação da rotina para armazenamento de arquivos.

Mapa de refeições realizadas

- Geração de dados para relatório das refeições realizadas;
- Inserção de aluno com role de comensal.

Pretensão de refeição

- Cálculo da pretensão;
- Login em PessoaController;

Validação

- Ajuste na validação no cadastro do aluno;
- Criação do serviço para a entidade Pessoa.

Consulta de pretensão

- Dia de refeição baseado na pretensão;
- Atenticação do serviço.

Aluno

- Adicionado a liste de refeições na entidade Aluno;
- Substituição da nomenclatra CronogramaRefeicao para DiaRefeicao.

Validação

- Validação para curso;
- Inclusão de código de validação na ErrorFactory.

GenericDao

- Manipulação de dados com a GenericDao;
- Serviço para consulta de aluno por Id, listagem e inserção.

Serviço de Aluno

- Cadastro e pesquisa de aluno por ID via serviço;
- Ajuste na classe AbstractDao2 (temporária);
- Remoção do ID para a classe ConfirmaRefeicaoDia que servirá de
artefato para a montagem da chave composta no hibernate.

NutrIF

- Controllers;
- Ajuste na classe Aluno.

NutrIF

- Integração entre o Commons e Service;
- Criação de classe de exemplo.

NutrIF

- Ajuste do diretório;
- Camada DAO.
